INSERT INTO `skin` VALUES (_binary '\0',0.8,0.06,_binary '\0',_binary '',515,'sfui_invpanel_filter_melee','Knives','#eb4b4b','This is a custom-designed balisong, commonly known as a butterfly knife. The defining characteristic of this weapon is the fan-like opening of a freely pivoting blade, allowing rapid deployment or concealment. As a result, butterfly knives are outlawed in many countries. It has individual parts spray-painted solid colors in a black and purple color scheme.\\n\\n<i>Elegant design paired with brutal intent</i>','skin-0063b0378b5b','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_butterfly_so_purple_light_png.png','★ Butterfly Knife | Ultraviolet','98','so_purple','Ultraviolet',NULL,'Covert','rarity_ancient_weapon','weapon_knife_butterfly','both','Both Teams','Butterfly Knife'),(_binary '',1,0,_binary '\0',_binary '',507,'sfui_invpanel_filter_melee','Knives','#eb4b4b','With its curved blade mimicking a tiger\'s claw, the karambit was developed as part of the southeast Asian martial discipline of silat. The knife is typically used with a reverse grip, with the finger ring on the index finger. It has been given a forced patina using lemon and mustard dripped onto the surface.\\n\\n<i>If you think it\'s messy now, wait until you see it under a blacklight</i>','skin-00ad6b64e94d','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_karambit_aq_forced_light_png.png','★ Karambit | Stained','43','aq_forced','Stained',NULL,'Covert','rarity_ancient_weapon','weapon_knife_karambit','both','Both Teams','Karambit'),(_binary '',0.7,0,_binary '\0',_binary '',11,'csgo_inventory_weapon_category_rifles','Rifles','#8847ff','The pricy G3SG1 lowers movement speed considerably but compensates with a higher rate of fire than other sniper rifles. It has been given yellow and grey accents.\\n\\n<i>A moment of pain.  Then nothing.</i>','skin-00b8673938d7','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_g3sg1_gs_g3sg1_viper_yellow_light_png.png','G3SG1 | Stinger','628','gs_g3sg1_viper_yellow','Stinger',NULL,'Restricted','rarity_mythical_weapon','weapon_g3sg1','terrorists','Terrorist','G3SG1'),(_binary '',0.45,0,_binary '\0',_binary '',2,'csgo_inventory_weapon_category_pistols','Pistols','#4b69ff','Firing two large-mag Berettas at once will lower accuracy and increase load times. On the bright side, you\'ll get to fire two large-mag Berettas at once. It has been custom painted in a military themed design.','skin-011747eede4b','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_elite_cu_retribution_light_png.png','Dual Berettas | Retribution','307','cu_retribution','Retribution',NULL,'Mil-Spec Grade','rarity_rare_weapon','weapon_elite','both','Both Teams','Dual Berettas'),(_binary '\0',0.8,0.06,_binary '',_binary '\0',38,'csgo_inventory_weapon_category_rifles','Rifles','#b0c3d9','The SCAR-20 is a semi-automatic sniper rifle that trades a high rate of fire and powerful long-distance damage for sluggish movement speed and big price tag. It has been spray-painted using mesh fencing and cardboard cutouts as stencils.\\n\\n<i>A predator is a predator, no matter the environment</i>','skin-0147ca1550c4','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_scar20_sp_mesh_sand_light_png.png','SCAR-20 | Sand Mesh','116','sp_mesh_sand','Sand Mesh',NULL,'Consumer Grade','rarity_common_weapon','weapon_scar20','counter-terrorists','Counter-Terrorist','SCAR-20'),(_binary '',0.8,0.06,_binary '\0',_binary '',516,'sfui_invpanel_filter_melee','Knives','#eb4b4b','Designed for efficient brutality, using a push dagger is as simple as throwing a punch or two. It has been painted using a forest camouflage hydrographic.\\n\\n<i>The woods can be a dangerous place... never travel alone</i>','skin-0150b0ce3f91','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_push_hy_forest_boreal_light_png.png','★ Shadow Daggers | Boreal Forest','77','hy_forest_boreal','Boreal Forest',NULL,'Covert','rarity_ancient_weapon','weapon_knife_push','both','Both Teams','Shadow Daggers'),(_binary '',1,0,_binary '\0',_binary '',506,'sfui_invpanel_filter_melee','Knives','#eb4b4b','The most notable feature of a gut knife is the gut hook on the spine of the blade.  Originally popularized as an aid for field dressing game, the gut hook is also effective at  cutting through fibrous materials like rope, webbing, or safety belts with ease. It has been given a forced patina using lemon and mustard dripped onto the surface.\\n\\n<i>If you think it\'s messy now, wait until you see it under a blacklight</i>','skin-0193aa320ffe','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_gut_aq_forced_light_png.png','★ Gut Knife | Stained','43','aq_forced','Stained',NULL,'Covert','rarity_ancient_weapon','weapon_knife_gut','both','Both Teams','Gut Knife'),(_binary '\0',0.08,0,_binary '\0',_binary '',512,'sfui_invpanel_filter_melee','Knives','#eb4b4b','A modern homage to a falchion sword, this clip point blade has a curved edge. It has been painted with black and silver metallic paints using a marbleizing medium, then candy coated.\\n\\n<i>Getting lost in its color can prove fatal</i>','skin-01c43b6ae7d3','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_falchion_am_doppler_phase1_light_png.png','★ Falchion Knife | Doppler','418','am_doppler_phase1','Doppler','Phase 1','Covert','rarity_ancient_weapon','weapon_knife_falchion','both','Both Teams','Falchion Knife'),(_binary '',0.7,0,_binary '\0',_binary '',16,'csgo_inventory_weapon_category_rifles','Rifles','#eb4b4b','More accurate but less damaging than its AK-47 counterpart, the M4A4 is the full-auto assault rifle of choice for CTs. This Sektor Industry firearm has been sleekly painted in yellow and green.\\n\\n<i>There\'s one at every party</i>','skin-01d7c60eddbb','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_m4a1_gs_m4a4_sector_light_png.png','M4A4 | Buzz Kill','632','gs_m4a4_sector','Buzz Kill',NULL,'Covert','rarity_ancient_weapon','weapon_m4a1','counter-terrorists','Counter-Terrorist','M4A4'),(_binary '\0',0.4,0,_binary '\0',_binary '',35,'csgo_inventory_weapon_category_heavy','Heavy','#4b69ff','The Nova\'s rock-bottom price tag makes it a great ambush weapon for a cash-strapped team. It has been painted using a hydrographic with an oversized camouflage pattern.','skin-01e00aac253c','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_nova_sp_camo_wood_blue_light_png.png','Nova | Ghost Camo','225','sp_camo_wood_blue','Ghost Camo',NULL,'Mil-Spec Grade','rarity_rare_weapon','weapon_nova','both','Both Teams','Nova'),(_binary '',0.5,0,_binary '\0',_binary '',25,'csgo_inventory_weapon_category_heavy','Heavy','#4b69ff','The XM1014 is a powerful fully automatic shotgun that justifies its heftier price tag with the ability to paint a room with lead fast. It has been painted using a translucent hydrographic with a terrain map motif over metallic silver paint.\\n\\n<i>Sometimes you need an unstable element to solve your problems - Kotaro Izaki, Breach Expert</i>','skin-024f8ae1278e','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_xm1014_aq_xm1014_sigla_light_png.png','XM1014 | Quicksilver','407','aq_xm1014_sigla','Quicksilver',NULL,'Mil-Spec Grade','rarity_rare_weapon','weapon_xm1014','both','Both Teams','XM1014'),(_binary '',0.4,0,_binary '\0',_binary '\0',4,'csgo_inventory_weapon_category_pistols','Pistols','#8847ff','The Glock 18 is a serviceable first-round pistol that works best against unarmored opponents and is capable of firing three-round bursts. It has been painted using a hydrographic of American hundred-dollar bills.\\n\\n<i>Money doesn\'t talk... it kills</i>','skin-028e0476ad38','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_glock_cu_money_glock_light_png.png','Glock-18 | Franklin','1016','cu_money_glock','Franklin',NULL,'Restricted','rarity_mythical_weapon','weapon_glock','terrorists','Terrorist','Glock-18'),(_binary '\0',0.8,0.06,_binary '',_binary '\0',27,'csgo_inventory_weapon_category_heavy','Heavy','#b0c3d9','The CT-exclusive Mag-7 delivers a devastating amount of damage at close range. Its rapid magazine-style reloads make it a great tactical choice. It has individual parts spray-painted solid colors in a sand dune color scheme.\\n\\n<i>With Turner dead, we have a new priority: rescue Alex Kincaide - Felix Riley, Commanding Officer</i>','skin-02ab67711447','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_mag7_so_sand_light_png.png','MAG-7 | Sand Dune','99','so_sand','Sand Dune',NULL,'Consumer Grade','rarity_common_weapon','weapon_mag7','counter-terrorists','Counter-Terrorist','MAG-7'),(_binary '',1,0,_binary '\0',_binary '',60,'csgo_inventory_weapon_category_rifles','Rifles','#eb4b4b','With a smaller magazine than its unmuffled counterpart, the silenced M4A1 provides quieter shots with less recoil and better accuracy. It has been painted with a hydrographic of an attacking snake.\\n\\n<i>The viper can strike from anywhere</i>','skin-02db706d8db0','https:/