amaging than its AK-47 counterpart, the M4A4 is the full-auto assault rifle of choice for CTs. It has been custom painted with multicolored crystals and finished with pearlescent accents.\\n\\n<i>Don\'t stew on it</i>','skin-b5bc3553f7e1','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_m4a1_soo_polysoup_m4a4_light_png.png','M4A4 | Polysoup','874','soo_polysoup_m4a4','Polysoup',NULL,'Restricted','rarity_mythical_weapon','weapon_m4a1','counter-terrorists','Counter-Terrorist','M4A4'),(_binary '',1,0,_binary '\0',_binary '',13,'csgo_inventory_weapon_category_rifles','Rifles','#8847ff','A less expensive option among the terrorist-exclusive assault rifles, the Galil AR is a serviceable weapon in medium to long-range combat. It has been given crimson accents and a hand painted icon.\\n\\n<i>Booth had this weapon commissioned for Valeria in an attempt to smooth things over with the Phoenix</i>','skin-b60d3982f423','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_galilar_gs_galilar_incenerator_light_png.png','Galil AR | Firefight','546','gs_galilar_incenerator','Firefight',NULL,'Restricted','rarity_mythical_weapon','weapon_galilar','terrorists','Terrorist','Galil AR');
INSERT INTO `skin` VALUES (_binary '\0',0.7,0,_binary '\0',_binary '\0',2,'csgo_inventory_weapon_category_pistols','Pistols','#5e98d9','Firing two large-mag Berettas at once will lower accuracy and increase load times. On the bright side, you\'ll get to fire two large-mag Berettas at once. The metal of these Dual Berettas has been painted rose gold and the grips are a nacred, deep jade color.\\n\\n<i>You can\'t make an omelette without cracking a few jeweled eggs</i>','skin-b6116401828b','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_elite_soo_rose_gold_light_png.png','Dual Berettas | Rose Nacre','1263','soo_rose_gold','Rose Nacre',NULL,'Industrial Grade','rarity_uncommon_weapon','weapon_elite','both','Both Teams','Dual Berettas'),(_binary '',1,0,_binary '\0',_binary '\0',19,'csgo_inventory_weapon_category_smgs','SMGs','#5e98d9','Easily recognizable for its unique bullpup design, the P90 is a great weapon to shoot on the move due to its high-capacity magazine and low recoil. Its stock has been wrapped in brown leather.\\n\\n<i>Don\'t worry, the safety is TSA compliant</i>','skin-b63301026060','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_p90_cu_brown_leather_p90_light_png.png','P90 | Leather','342','cu_brown_leather_p90','Leather',NULL,'Industrial Grade','rarity_uncommon_weapon','weapon_p90','both','Both Teams','P90'),(_binary '\0',0.8,0.06,_binary '\0',_binary '\0',5034,'sfui_invpanel_filter_gloves','Gloves','#eb4b4b','Durable, breathable, and stylish; these gloves are designed to take (and give) a beating. These practical gloves would be at home in a hunting blind.','skin-b6c2f9e4afaa','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/specialist_gloves_specialist_forest_brown_light_png.png','★ Specialist Gloves | Buckshot','100