_ancient_weapon','weapon_knife_outdoor','both','Both Teams','Nomad Knife'),(_binary '\0',0.08,0,_binary '\0',_binary '',520,'sfui_invpanel_filter_melee','Knives','#eb4b4b','This marble-enamel-handled flip knife conceals a small but viciously tapered blade. It has been painted with black and silver metallic paints using a marbleizing medium, then candy coated.\\n\\n<i>Getting lost in its color can prove fatal</i>','skin-b790da07f599','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_gypsy_jackknife_am_sapphire_marbleized_light_png.png','★ Navaja Knife | Doppler','416','am_sapphire_marbleized','Doppler','Sapphire','Covert','rarity_ancient_weapon','weapon_knife_gypsy_jackknife','both','Both Teams','Navaja Knife'),(_binary '\0',0.8,0.06,_binary '',_binary '\0',27,'csgo_inventory_weapon_category_heavy','Heavy','#8847ff','The CT-exclusive Mag-7 delivers a devastating amount of damage at close range. Its rapid magazine-style reloads make it a great tactical choice. It has individual parts spray-painted solid colors in a production line yellow color scheme.\\n\\n<i>This bone crusher is a devastator</i>','skin-b7fa0b0519bd','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_mag7_so_yellow_light_png.png','MAG-7 | Bulldozer','39','so_yellow','Bulldozer',NULL,'Restricted','rarity_mythical_weapon','weapon_mag7','counter-terrorists','Counter-Terrorist','MAG-7'),(_binary '',0.55,0.06,_binary '\0',_binary '\0',2,'csgo_inventory_weapon_category_pistols','Pistols','#5e98d9','Firing two large-mag Berettas at once will lower accuracy and increase load times. On the bright side, you\'ll get to fire two large-mag Berettas at once. It has been painted using a rust-tinted hydrographic of a gel pen doodle.\\n\\n<i>Honor your dead</i>','skin-b7fcc2dc0ddc','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/