. It has been painted using a Digital Disruptive Pattern (DDPAT) hydrographic.\\n\\n<i>By the time you\'re close enough to notice the pixels it\'s already too late</i>','skin-b862260eaab4','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_canis_hy_ddpat_light_png.png','★ Survival Knife | Forest DDPAT','5','hy_ddpat','Forest DDPAT',NULL,'Covert','rarity_ancient_weapon','weapon_knife_canis','both','Both Teams','Survival Knife'),(_binary '',0.32,0.08,_binary '\0',_binary '',19,'csgo_inventory_weapon_category_smgs','SMGs','#eb4b4b','Easily recognizable for its unique bullpup design, the P90 is a great weapon to shoot on the move due to its high-capacity magazine and low recoil. It has been hydro-dipped with a graphic of overlapping cat skulls.','skin-b8631ce3380d','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_p90_cu_catskulls_p90_light_png.png','P90 | Death by Kitty','156','cu_catskulls_p90','Death by Kitty',NULL,'Covert','rarity_ancient_weapon','weapon_p90','both','Both Teams','P90'),(_binary '',0.81,0,_binary '\0',_binary '',39,'csgo_inventory_weapon_category_rifles','Rifles','#4b69ff','The terrorist-exclusive SG553 is a premium scoped alternative to the AK47 for effective long-range engagement. It has been given a modern camouflage hydrographic.\\n\\n<i>It was once a design earmarked for the Coalition Taskforce, but Huxley engaged in corporate espionage to make it a Phoenix exclusive</i>','skin-b86e591b7a8e','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_sg556_cu_sg553_atlas_light_png.png','SG 553 | Atlas','553','cu_sg553_atlas','Atlas',NULL,'Mil-Spec Grade','rarity_rare_weapon','weapon_sg556','terrorists','Terrorist','SG 553'),(_binary '\0',0.75,0,_binary '\0',_binary '\0',9,'csgo_inventory_weapon_category_rifles','Rifles','#d32ce6','High risk and high reward, the infamous AWP is recognizable by its signature report and one-shot, one-kill policy. A yellow streak runs the length of this custom painted, green metallic flake AWP.\\n\\n<i>Energy amplified</i>','skin-b889cea4b0a8','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_awp_cue_jump_line_light_png.png','AWP | Green Energy','1280','cue_jump_line','Green Energy',NULL,'Classified','rarity_legendary_weapon','weapon_awp','both','Both Teams','AWP'),(_binary '\0',0.6,0,_binary '\0',_binary '\0',61,'csgo_inventory_weapon_category_pistols','Pistols','#8847ff','A fan favorite from Counter-Strike Source, the Silenced USP Pistol has a detachable silencer that gives shots less recoil while suppressing attention-getting noise. It has been custom painted with a solid blue slide and finished with gold accents.\\n\\n<i>It is rare that beauty is so obvious</i>','skin-b88bf24d8569','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_usp_silencer_soe_blue_and_gold_light_png.png','USP-S | Royal Guard','1217','soe_blue_and_gold','Royal Guard',NULL,'Restricted','rarity_mythical_weapon','weapon_usp_silencer','counter-terrorists','Counter-Terrorist','USP-S'),(_binary '',0.3,0,_binary '\0',_binary '',35,'csgo_inventory_weapon_category_heavy','Heavy','#8847ff','The Nova\'s rock-bottom price tag makes it a great ambush weapon for a cash-strapped team. It has been covered in a lizard skin decal.\\n\\n<i>You\'re acting like you\'ve never been held captive by mercenaries before – The Oni and The Valkyrie Part 1</i>','skin-b935cdf1da4b','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_nova_am_nova_sand_light_png.png','Nova | Gila','634','am_nova_sand','Gila',NULL,'Restricted','rarity_mythical_weapon','weapon_nova',