ag7','SWAG-7',NULL,'Restricted','rarity_mythical_weapon','weapon_mag7','counter-terrorists','Counter-Terrorist','MAG-7'),(_binary '',1,0,_binary '\0',_binary '',515,'sfui_invpanel_filter_melee','Knives','#eb4b4b','This is a custom-designed balisong, commonly known as a butterfly knife. The defining characteristic of this weapon is the fan-like opening of a freely pivoting blade, allowing rapid deployment or concealment. As a result, butterfly knives are outlawed in many countries. It has been stonewashed and given a black laminate handle.','skin-f022f759f62a','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_butterfly_gs_butterfly_black_laminate_light_png.png','★ Butterfly Knife | Black Laminate','1110','gs_butterfly_black_laminate','Black Laminate',NULL,'Covert','rarity_ancient_weapon','weapon_knife_butterfly','both','Both Teams','Butterfly Knife'),(_binary '',0.8,0.06,_binary '\0',_binary '',506,'sfui_invpanel_filter_melee','Knives','#eb4b4b','The most notable feature of a gut knife is the gut hook on the spine of the blade.  Originally popularized as an aid for field dressing game, the gut hook is also effective at  cutting through fibrous materials like rope, webbing, or safety belts with ease. It has been painted using a forest camouflage hydrographic.\\n\\n<i>The woods can be a dangerous place... never travel alone</i>','skin-f02460b450ee','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_gut_hy_forest_boreal_light_png.png','★ Gut Knife | Boreal Forest','77','hy_forest_boreal','Boreal Forest',NULL,'Covert','rarity_ancient_weapon','weapon_knife_gut','both','Both Teams','Gut Knife'),(_binary '',1,0,_binary '\0',_binary '',24,'csgo_inventory_weapon_category_smgs','SMGs','#d32ce6','The misunderstood middle child of the SMG family, the UMP45\'s small magazine is the only drawback to an otherwise versatile close-quarters automatic. Beneath sketches of bullets, a crown, and other designs, bands of neon color are the base of this custom painted UMP-45.\\n\\n<i>The concept is simple, it\'s the execution that\'s difficult</i>','skin-f04de3b20f62','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_ump45_cu_ump_clutch_kick_light_png.png','UMP-45 | Wild Child','1236','cu_ump_clutch_kick','Wild Child',NULL,'Classified','rarity_legendary_weapon','weapon_ump45','both','Both Teams','UMP-45'),(_binary '',0.26,0.01,_binary '\0',_binary '',517,'sfui_invpanel_filter_melee','Knives','#eb4b4b','This fixed-blade survival knife is designed to withstand being used as both a weapon and a tool, such as for setting traps, hunting animals or cutting foliage. The handle is wrapped in a length of multi-purpose paracord. It has been painted in a zebra-stripe pattern with aluminum and chrome paints with various reflectivities, and has then been covered with a tomato red candy coat.\\n\\n<i>Valeria doesn\'t pay Javier to ask questions... she pays him to pry out answers<i>','skin-f04f7388bd8b','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/static/panorama/images/econ/default_generated/weapon_knife_cord_am_zebra_light_png.png','★ Paracord Knife | Slaughter','59','am_zebra','Slaughter',NULL,'Covert','rarity_ancient_weapon','weapon_knife_cord','both','Both Teams','Paracord Knife'),(_binary '',1,0,_binary '\0',_binary '',39,'csgo_inventory_weapon_category_rifles','Rifles','#d32ce6','The terrorist-exclusive SG553 is a premium scoped alternative to the AK47 for effective long-range engagement. It has been custom painted with a high-tech design in black, white, and red.\\n\\n<i>Sebastien is coming for me Valeria... we don\'t have much time - Chase Turner, Coalition Defector</i>','skin-f0772ea6839f','https://raw.githubusercontent.com/ByMykel/counter-strike-image-tracker/main/sta